import React from "react";
import Papa from "papaparse";

export default function ImportCSV() {
  const handleFile = (event) => {
    Papa.parse(event.target.files[0], {
      complete: function (result) {
        const data = [];
        // console.log(result);
        result.data.map((d) => {
          return data.push({ name: d.name, email: d.email, avatar: d.avatar });
        });
      },
    });
  };
  return (
    <div className="App">
      <h1>Import</h1>
      <input
        type="file"
        name="file"
        accept=".csv"
        onChange={handleFile}
      ></input>
    </div>
  );
}
